import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Navbar.css';
import logo from '../../assets/LOGO.png';
import axios from 'axios';
import { Search } from 'lucide-react';

const Navbar = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');
  const [searchResults, setSearchResults] = useState({ hotels: [], restaurants: [] });
  const [isSearchOpen, setIsSearchOpen] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  // ... (keep the existing useEffect and signOut functions)

  const handleSearch = async (e) => {
    e.preventDefault();
    if (searchQuery) {
      setIsLoading(true);
      setError(null);
      try {
        const { data } = await axios.get(`http://localhost:5000/api/search`, { params: { city: searchQuery } });
        setSearchResults(data);
      } catch (error) {
        console.error('Error fetching search results:', error);
        setError('An error occurred while searching. Please try again.');
      } finally {
        setIsLoading(false);
      }
    }
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/" className="navbar-logo">
          <img src={logo} alt="Logo" />
          <span>Voyaige</span>
        </Link>
        <ul className="navbar-menu">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/tours">Tours</Link></li>
          <li><Link to="/hotels">Hotels</Link></li>
          <li><Link to="/restaurants">Eat & Drink</Link></li>
        </ul>
        <div className="navbar-actions">
          <div className="search-container">
            <button onClick={() => setIsSearchOpen(!isSearchOpen)} className="search-toggle">
              <Search size={24} />
            </button>
            {isSearchOpen && (
              <form onSubmit={handleSearch} className="search-form">
                <input
                  type="text"
                  placeholder="Search by city..."
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                />
                <button type="submit" disabled={isLoading}>
                  {isLoading ? 'Searching...' : 'Search'}
                </button>
              </form>
            )}
          </div>
          {isAuthenticated ? (
            <button className="auth-button" onClick={signOut}>Log Out</button>
          ) : (
            <Link className="auth-button" to="/login">Sign In</Link>
          )}
        </div>
      </div>
      {isSearchOpen && searchResults.hotels.length + searchResults.restaurants.length > 0 && (
        <div className="search-results">
          {searchResults.hotels.length > 0 && (
            <div className="result-section">
              <h3>Hotels</h3>
              <ul>
                {searchResults.hotels.map((hotel) => (
                  <li key={hotel._id}>{hotel.name}</li>
                ))}
              </ul>
            </div>
          )}
          {searchResults.restaurants.length > 0 && (
            <div className="result-section">
              <h3>Restaurants</h3>
              <ul>
                {searchResults.restaurants.map((restaurant) => (
                  <li key={restaurant._id}>{restaurant.name}</li>
                ))}
              </ul>
            </div>
          )}
        </div>
      )}
      {error && <p className="error-message">{error}</p>}
    </nav>
  );
};

export default Navbar;
